script: |
  super -f text -I q9176.spq | sort > q9176.out

inputs:
  - name: q9176.spq
    data: |
      SELECT - COUNT ( * ) FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT 89 NOT BETWEEN + 74 / - col0 + + col1 + - - col0 AND col0 * 40;
  - name: tab1

outputs:
  - name: q9176.out
    data: |
      -1
